import java.util.HashMap;
import java.util.Map;

public class Anagram {
    public static boolean isAnagram(String s, String t) {
        // Can be improved by using array of 26 length as hashtable and incrementing
        // count for one string and decrementing count for other.
        // Then if any count is greater than 0 it is not an anagram
        Map<Character, Integer[]> myMap = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            if (myMap.containsKey(s.charAt(i))) {
                myMap.get(s.charAt(i))[0]++;
            } else {
                myMap.put(s.charAt(i), new Integer[] { 1, 0 });
            }
        }

        for (int i = 0; i < t.length(); i++) {
            if (myMap.containsKey(t.charAt(i))) {
                myMap.get(t.charAt(i))[1]++;
            } else {
                myMap.put(t.charAt(i), new Integer[] { 0, 1 });
            }
        }
        myMap.entrySet().forEach(entrySet -> {
            if (entrySet.getValue()[0] == entrySet.getValue()[1])
                System.out.println(entrySet.getKey() + " " + entrySet.getValue()[0] + " " + entrySet.getValue()[1]);
        });

        return myMap.entrySet().stream().allMatch(entrySet -> entrySet.getValue()[0].equals(entrySet.getValue()[1]));

    }

    public static void main(String[] args) {
        String t = "";
        String s = "";
        System.out.println("Strings are anagrams of each other: " + isAnagram(s, t));
    }
}
